      DB::statement("INSERT INTO settings VALUES(
        1, 
        'Happy Holidayers', 
        'admin@trackitinerary.com', 
        'trackitinerary@gmail.com', 
        5, 
        'trackitine1rary@gmail.com', 
        'Service Team', 
        '098160 681162', 
        'operations@trackitinerary.com', 
        'Hotel Booking Team', 
        '098160 681165', 
        'bookings@trackitinerary.com', 
        'operations@trackitinerary.com', 
        'Vehicle Booking Team ', 
        '098160 681121', 
        '+098160 681', 
        'in222fo@trackitinerary.com',  
        '&lt;p trebuchet=&quot;&quot; ms&quot;;&quot;=&quot;&quot; style=&quot;color: rgb(51, 51, 51);&quot;&gt;&lt;span style=&quot;font-family: &amp;quot;Arial Black&amp;quot;;&quot;&gt;?&lt;/span&gt;&lt;span style=&quot;font-family: &amp;quot;Arial Black&amp;quot;;&quot;&gt;You will find below the package that we propose for your unique vacation experience. Based on the preferences that you have highlighted to us previously, we feel that this plan would be the best arrangement. However, if there are further changes that you would like to add, we will be happy to amend it.&lt;/span&gt;&lt;/p&gt;&lt;p trebuchet=&quot;&quot; ms&quot;;&quot;=&quot;&quot; style=&quot;color: rgb(51, 51, 51);&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-size: 1rem; font-family: &amp;quot;Arial Black&amp;quot;;&quot;&gt;trackitinerary&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-size: 1rem;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Tahoma;&quot;&gt;Travels has enjoyed helping thousands of&lt;/span&gt;&lt;span style=&quot;font-family: &amp;quot;Arial Black&amp;quot;;&quot;&gt; peop&lt;/span&gt;le experience amazing holidays, and we aim to do the same for you. Here&rsquo;s to an unforgettable trip ahead!&lt;/p&gt;&lt;p trebuchet=&quot;&quot; ms&quot;;&quot;=&quot;&quot; style=&quot;color: rgb(51, 51, 51);&quot;&gt;&lt;img style=&quot;width: 249px;&quot; src=&quot;data:image/png;base64,', 
    
